    public static Bitmap decode(String image) {
        byte[] imgByte = Base64.decode(image, Base64.DEFAULT);
        Bitmap bitmap = BitmapFactory.decodeByteArray(imgByte, 0, imgByte.length);
        if (bitmap != null) {
            return bitmap;
        } else {
            return null;
        }
    }
